Heres a focused review of the 325px screenshots with concrete fixes. Ill call out anything I can see and give CSS suggestions.

---

##  1. Layout overflow
**Issue:** No hard horizontal overflow, but the card width + inner padding is very tight, making the layout feel cramped. The cards are almost edgetoedge and the title text breaks into a tall column.

**Fix:**
```css
.page-content, .chat-response {
  padding-left: 12px;
  padding-right: 12px;
}

.horse-card {
  width: 100%;
  margin: 0 auto 20px;
}
```

---

##  2. Touch targets (44px minimum)
**Issue:** The STANDARD, price, and CHAPTER 4+ buttons look under 44px tall. At this width, they appear closer to ~3438px.

**Fix:**
```css
.horse-card .btn,
.horse-card .badge,
.horse-card .price {
  min-height: 44px;
  padding: 10px 16px;
  line-height: 1.2;
}
```

---

##  3. Text readability
**Issue:** The decorative font is heavy + narrow at this size. Long horse names become a vertical stack thats hard to scan. The paragraph text is okay, but the title (Best horse for pure top speed) is large and uses gold, which has low contrast on dark gray.

**Fix (title contrast + size):**
```css
.page-title {
  font-size: 24px;
  color: #e2c15a; /* slightly brighter */
  line-height: 1.2;
}
```

**Fix (horse name readability):**
```css
.horse-card .horse-name {
  font-size: 20px;
  line-height: 1.25;
  text-align: center;
  max-width: 90%;
  margin: 0 auto;
}
```

---

##  4. Chat bubble formatting
**Issue:** The AI response shows raw markdown (`**Max Speed 9**`, `**Chapter 4+**`) and has an awkward line-breaked bullet with em dash. That looks like the markdown isnt being parsed or sanitized.

**Fix:**
- Ensure markdown is rendered properly in chat output.
- Or strip markdown and render a clean list.

**CSS fix if you render markdown:**
```css
.chat-response ul {
  margin: 12px 0;
  padding-left: 18px;
}

.chat-response li {
  margin-bottom: 8px;
}
```

---

##  5. Horse cards at 325px
**Issue:** The image is readable, but the card is too tall due to multiline names. That pushes important info (price, stats) far below and makes scanning hard.

**Fix:** Allow name to wrap more naturally and reduce vertical spacing.
```css
.horse-card .horse-name {
  margin-bottom: 12px;
}

.horse-card .meta {
  margin-top: 8px;
}
```

Also consider **shortening the name on mobile** or using a smaller font.

---

##  6. Input area usability
**Issue:** Input area not shown in these screenshots, so I cant verify. At 325px width, make sure the input + send button are fullwidth and at least 44px tall.

**Recommendation:**
```css
.chat-input textarea,
.chat-input button {
  min-height: 44px;
  font-size: 16px; /* avoids iOS zoom */
}
```

---

##  7. Visual bugs
**Issue:** The message contains a duplicate horse card (Missouri Fox Trotter  Silver Dapple Pinto appears twice in the same place). This reads like a rendering/loop issue or duplicate array entry.

**Action:** Check rendering loop keys or backend response duplication.

---

### Summary of primary issues
- **Buttons too small** for touch.
- **Horse name text stacks too tall**, hurting scanability.
- **Markdown not rendered**, showing `**` in output.
- **Possible duplicate card** rendering bug.

If you want, send the HTML/CSS snippets for the horse card and chat response and Ill give more precise selectors.
